    false,nt"url": null,nt"notes": "The lower Columbia population of Columbian
    White-tailed deer CWTDu2014Odocoileus virginianus leucurus) is an endangered population
    that has undergone a dramatic reduction in historical range. The former range is
    interspersed with Columbian black-tailed deer (CBTD, Odocoileus hemionus columbianus)
    populations that have shifted with the loss of CWTD. While black-tailed deer tend
    to inhabit more densely forested areas than white-tailed deer, there is a significant
    amount of overlap, and CBTD readily occupy riparian lowlands when densities of Columbian
    white-tailed deer are reduced (Smith 1987). The decline of CWTD in the early 1900s
    has allowed CBTD to expand their range to occupy much of the former CWTD habitat.
    The translocation of white-tailed deer back into their former range has increased
    the level of overlap of the species in several areas.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
